"use strict";

ymaps.ready(init);
function init() {
  // Создание карты.
  var myMap = new ymaps.Map("map", {
    // Координаты центра карты.
    // Порядок по умолчанию: «широта, долгота».
    // Чтобы не определять координаты центра карты вручную,
    // воспользуйтесь инструментом Определение координат.
    center: [55.760004, 37.600070],
    // Уровень масштабирования. Допустимые значения:
    // от 0 (весь мир) до 19.
    zoom: 13
  });
  var myPlacemark = new ymaps.Placemark([55.769534, 37.638440], {}, {
    iconLayout: 'default#image',
    iconImageHref: './images/placemark.svg',
    iconImageSize: [12, 12]
  });
  myMap.geoObjects.add(myPlacemark);
}
function createBurger() {
  var burger = document.querySelector('.burger');
  var menu = document.querySelector('.header__nav');
  var menuLinks = document.querySelectorAll('.header__item');
  var closeBtn = document.getElementById('close-burger');
  burger.addEventListener('click', function () {
    burger.classList.toggle('burger--active');
    menu.classList.toggle('header__nav--active');
    document.body.classList.toggle('stop-scroll');
  });
  menuLinks.forEach(function (el) {
    el.addEventListener('click', function () {
      burger.classList.remove('burger--active');
      menu.classList.remove('header__nav--active');
      document.body.classList.remove('stop-scroll');
    });
  });
  closeBtn.addEventListener('click', function () {
    burger.classList.remove('burger--active');
    menu.classList.remove('header__nav--active');
    document.body.classList.remove('stop-scroll');
  });
}
createBurger();
function createSearch() {
  var search = document.querySelector('.search');
  var searchBtn = document.querySelector('.search__btn');
  var searchInput = document.querySelector('.search__input');
  var closeBtn = document.querySelector('.close__btn');
  searchBtn.addEventListener('click', function () {
    search.classList.toggle('search--active');
    searchBtn.classList.toggle('search__btn--active');
    searchInput.classList.toggle('search__input--active');
    closeBtn.classList.toggle('close__btn--active');
  });
  closeBtn.addEventListener('click', function () {
    search.classList.toggle('search--active');
    searchBtn.classList.toggle('search__btn--active');
    searchInput.classList.toggle('search__input--active');
    closeBtn.classList.toggle('close__btn--active');
  });
}
createSearch();
